import React from 'react'
import styles from '../c_iphone-14-3.module.css'
import rectangle from "../assets3/rectangle.png";
import foodrecipes from "../assets3/foodrecipes.png";
import sendok from "../assets3/sendok.png";
import search from "../assets3/search.png";
import rectangle1 from "../assets3/rectangle1.png";
import rumah from "../assets3/rumah.png";
import save from "../assets3/save.png";
import save2 from "../assets3/save2.png";
import save3 from "../assets3/save3.png";
import akun from "../assets3/akun.png";
import 'bootstrap/dist/css/bootstrap.min.css';
import bg from '../assets/bg.jpg' // gambar
import image from '../assets3/image1.png' // gambar
import { Link } from "react-router-dom";

const HomePage = () => {
    return (
        <div className={
            styles['frame2']
        }>
            <div className='bg-slate-300 min-h-screen'>
                <div className=''>
                    <img src={rectangle}
                        alt="rectangle"
                        className='w-full h-20' />
                    <div className='absolute inset-x-0 top-0'>
                        <img src={foodrecipes}
                            alt="rectangle"
                            className={
                                styles['font1']
                            } />
                        <img src={sendok}
                            alt="rectangle"
                            className={
                                styles['sendok']
                            } />
                        <img src={search}
                            alt="rectangle"
                            className={
                                styles['search']
                            } />
                    </div>
                    <div className=''>
                        <div className={
                            styles['alltext']
                        }>
                            <div className={
                                styles['instance']
                            }>
                                <div className={
                                    styles['text02']
                                }>
                                    <p className={
                                        styles['text03']
                                    }>Sarapan</p>
                                </div>
                            </div>
                            <div className={
                                styles['text04']
                            }>
                                <p className={
                                    styles['text05']
                                }>Makan siang</p>
                            </div>
                            <div className={
                                styles['text06']
                            }>
                                <p className={
                                    styles['text07']
                                }>Camilan</p>
                            </div>
                            <div className={
                                styles['text08']
                            }>
                                <p className={
                                    styles['text09']
                                }>Makan malam</p>
                            </div>
                        </div>
                        <input type="search" />
                        <Link to="/new">
                            <button className={
                                styles['rectangle9']
                            }>NEW</button>
                        </Link>
                    </div>
                    <div></div>
                    <div className={
                        styles['kertas01']
                    }>
                        <img src={rectangle1}
                            alt="rectangle"
                            className='w-full h-24 absolute inset-x-0' />
                    </div>
                    <div className='relative inset-x-0 bottom-4'>
                        <Link to="/homepage">
                            <img src={rumah}
                                alt="rectangle"
                                className={
                                    styles['rumah']
                                } /></Link>
                        <Link to="/save">
                            <img src={save}
                                alt="rectangle"
                                className={
                                    styles['save']
                                } /></Link>
                        <Link to="/user">
                            <img src={akun}
                                alt="rectangle"
                                className={
                                    styles['akun']
                                } /></Link>
                    </div>
                </div>
                {/* <div className='container mt-0'>
                <div className={styles['card']}>
                <div className="card" style={{ width: '11rem'}}>
                            <img src={bg} className="card-img-top" alt="..." />
                            <div className="card-body">
                                <h5 className="card-title">Judul Kartu</h5>
                                <p className="card-text">Teks penjelasan mengenai kartu.</p>
                                <a href="#" className="btn btn-primary">Tombol</a>
                            </div>
                </div>
                </div>
                </div> */}
                <div className={
                    styles['card3']
                }>
                    <div className="row">

                        <div className="col-md-4 col-sm-12 mb-15">
                            <Link to="/recipe">
                                <div className="card">
                                    <img src={image}
                                        className="card-img-top"
                                        alt="..." />
                                    <div className="card-body">
                                        <div className="card-title">
                                            <h4>Toast with Milk and Strawberry</h4>
                                        </div>
                                    </div>
                                </div>
                            </Link>
                            <img src={save2}
                                alt="rectangle"
                                className={
                                    styles['save2']
                                } />
                        </div>

                        <div className="col-md-4 col-sm-12 mb-15">
                            <Link to="/recipe">
                                <div className="card">
                                    <img src={image}
                                        className="card-img-top"
                                        alt="..." />
                                    <div className="card-body">
                                        <div className="card-title">
                                            <h4>Toast with Milk and Strawberry</h4>
                                        </div>
                                    </div>
                                </div>
                            </Link>
                            <img src={save3}
                                alt="rectangle"
                                className={
                                    styles['save3']
                                } />
                        </div>

                        <div className="col-md-4 col-sm-12 mb-15">
                            <Link to="/recipe">
                                <div className="card">
                                    <img src={image}
                                        className="card-img-top"
                                        alt="..." />
                                    <div className="card-body">
                                        <div className="card-title">
                                            <h4>Toast with Milk and Strawberry</h4>
                                        </div>
                                    </div>
                                </div>
                            </Link>
                            <img src={save3}
                                alt="rectangle"
                                className={
                                    styles['save3']
                                } />
                        </div>

                    </div>
                </div>
            </div>
        </div>
    )
}

export default HomePage
